  input: TEXT,F3A,,"On the FEC Notice dated April 8, 2005, the FEC requested a brief
    statement as to why the Friends of Melissa Brown campaign voided a check to UTA
    Associates for $16,265.20.  During January, 2005, UTA Associates returned the
    original, uncashed $16,265.20 check issued to us along with a note requesting
    that the Friends of Melissa Brown campaign re-issue this disbursement by splitting
    the amount into two separate checks for the UTA Associates' accounting and recordkeeping.  Accordingly,
    the Friends of Melissa Brown campaign honored their request by re-issuing this
    disbursement in two separate checks on January 20, 2005 (and is presented as such
    on our 1st Quarter 2005 FEC Report) and since we received the original, uncashed
    $16,265.20 disbursement prior to filing our Year-End 2004 FEC Report, we reported
    the original disbursement as voided on 12/31/2004."
